/**
 *
 * Navigation.js/styles.scss.tsx
 * @author Peter Laxalt
 * @description The website Navigation Styles.
 *
 */

// Imports
//////////////////////////////////////////////////////////////////////

// Core
import React, { Component } from "react";
import { canvas } from "../../../sketches/three/t13";
import { createGlobalStyle } from "styled-components";

// Components

import { FrameEight } from "../../../components/25/8";

// Begin Component
//////////////////////////////////////////////////////////////////////

const currentSketch = 8;
const theme = {
  textColor: "#0d132a",
  bgColor: "#d5fdd2"
};

const HideNav = createGlobalStyle`
  .nav {
    display: none;
  }
`;

class p3 extends Component<{}, any> {
  componentDidMount() {
    if (typeof window) {
      // @ts-ignore
      canvas(this.threeRootElement);
    }
  }
  render() {
    return (
      <>
        <HideNav />
        <FrameEight theme={theme} currentSketch={currentSketch} />
        <div
          // @ts-ignore
          ref={element => (this.threeRootElement = element)}
          style={{ width: "100vw", height: "100vh" }}
        />
      </>
    );
  }
}

export default p3;
